        require (
            (srcCurrencyIndex >= CurrencyIndex(0) && srcCurrencyIndex < CurrencyIndex.CURRENCY_COUNT) &&
            (dstCurrencyIndex >= CurrencyIndex(0) && dstCurrencyIndex < CurrencyIndex.CURRENCY_COUNT),
            "Invalid coin index"
        );
